import React from "react";

export const Catalog = ({products}) => {

    return(
        <div className="catalog">
            {products.map((product) => (
                <div className="catalog-preview" key={product.id}>
                    <h2>{product.name}</h2>
                    <p>{product.weight}</p>
                </div>
            ))}
        </div>
    )
}
